func Test_maxSumSubmatrix(t *testing.T) {
	ast := assert.New(t)

	for _, tc := range tcs {
		// fmt.Printf("~~%v~~\n", tc)
		ast.Equal(tc.ans, maxSumSubmatrix(tc.matrix, tc.k))
	}
}

func Benchmark_maxSumSubmatrix(b *testing.B) {
	for i := 0; i < b.N; i++ {
		for _, tc := range tcs {
			maxSumSubmatrix(tc.matrix, tc.k)
		}
	}
}
